import { Link } from "react-router-dom"; // import Link here
import "./Home.css";

function Home() {
    return (
      <div className="home">
        <h1 className="Title">Welcome!</h1> 
        <h3 className="subtitle">Tell us WHO are you?</h3>
       
        <div className="button">
          <Link to="/Auth">
            <button className="btn-admin btn">Admin</button>
          </Link>  
         
                    
        </div>  
        <Link to="/App">    
            <button  className="btn btn-white btn-animate"> User</button>
          </Link>      
      </div>  
    );
  }
  
  export default Home;
